import React, { useEffect } from "react";

const App = () => {
  useEffect(() => {
    let string = "chaine";
    let number = 90;
    let array = [
      "ok",
      8,
      ["hello", "toulose"],
      { nom: "Denis", prenom: "Moussa" }
    ];
    let boolean = true;
    let maVariable; //undifined
    array[2].shift();
    console.log(array[3].prenom);

    let objet = {
      pseudo: "Moussa",
      age: 30,
      techno: ["Javascript", " nodeJs", "Pythion"],
      admin: true
    };
    console.log(typeof objet.techno.length);
  });
  return <></>;
};

export default App;
